// LoadImage 读取指定路径的图片并返回 image.Image 对象。
// 支持 JPEG 和 PNG 格式的图片。
func LoadImage(filePath string) (image.Image, error) {
	// 打开图片文件
	file, err := os.Open(filePath)
	if err != nil {
		return nil, fmt.Errorf("无法打开图片文件: %v", err)
	}
	defer file.Close()

	// 根据文件扩展名选择合适的解码器
	var img image.Image
	switch strings.ToLower(filePath[len(filePath)-4:]) {
	case ".jpg", "jpeg":
		img, err = jpeg.Decode(file)
	case ".png":
		img, err = png.Decode(file)
	default:
		return nil, fmt.Errorf("不支持的图片格式")
	}

	if err != nil {
		return nil, fmt.Errorf("图片解码失败: %v", err)
	}

	return img, nil
}

// 图片转一维数组数据
// ImageToGrayFloatArray 将灰度图像转换为一维浮点数组，范围为 [0.0, 1.0]
func ImageToGrayFloatArray(img image.Image) []float32 {
	bounds := img.Bounds()
	width, height := bounds.Max.X, bounds.Max.Y
	floatArray := make([]float32, width*height) // 只需单通道

	index := 0
	for y := 0; y < height; y++ {
		for x := 0; x < width; x++ {
			// 获取灰度值
			grayColor := color.GrayModel.Convert(img.At(x, y)).(color.Gray)
			grayValue := grayColor.Y

			// 将灰度值归一化为 [0.0, 1.0]
			floatArray[index] = float32(grayValue) / 255.0
			index++
		}
	}

	return floatArray
}

// ConvertToGray 将彩色图像转换为灰度图
func ConvertToGray(img image.Image) *image.Gray {
	bounds := img.Bounds()
	grayImg := image.NewGray(bounds)

	// 手动将 RGB 转换为灰度值，使用标准加权公式
	for y := bounds.Min.Y; y < bounds.Max.Y; y++ {
		for x := bounds.Min.X; x < bounds.Max.X; x++ {
			originalColor := img.At(x, y)
			r, g, b, _ := originalColor.RGBA()

			// RGB 转灰度，标准加权公式
			// Java的加权公式： 0.299 * R + 0.587 * G + 0.114 * B
			// Go 中 RGBA 的值范围是 [0, 65535]，需要缩放到 [0, 255]
			grayValue := uint8(0.299*float64(r)/257 + 0.587*float64(g)/257 + 0.114*float64(b)/257)
			grayImg.Set(x, y, color.Gray{Y: grayValue})
		}
	}

	return grayImg
}

func imageEncode(fileName string, file *os.File, rgba *image.RGBA) error {
	// 将图片和扩展名分离
	stringSlice := strings.Split(fileName, ".")
	// 根据图片的扩展名来运用不同的处理
	switch stringSlice[len(stringSlice)-1] {
	case "jpg":
		return jpeg.Encode(file, rgba, nil)
	case "jpeg":
		return jpeg.Encode(file, rgba, nil)
	case "gif":
		return gif.Encode(file, rgba, nil)
	case "png":
		return png.Encode(file, rgba)
	default:
		panic("不支持的图片类型")
	}
}

// ResizeImage 将图片缩放到指定宽度和高度并返回 RGB 图像
func ResizeImage(img image.Image, width, height uint) *image.RGBA {
	// 使用 resize 库进行平滑缩放
	resized := resize.Resize(width, height, img, resize.Lanczos3)

	// 创建目标 RGB 图像
	rgbImg := image.NewRGBA(image.Rect(0, 0, int(width), int(height)))

	// 将缩放后的图像绘制到 RGB 图像上
	draw.Draw(rgbImg, rgbImg.Bounds(), resized, image.Point{}, draw.Src)

	return rgbImg
}

// 像素干扰
func ImageRGBDisturb(img image.Image) image.Image {
	bounds := img.Bounds()
	rand.Seed(time.Now().UnixNano())
	// 创建新图像
	newImg := image.NewRGBA(bounds)

	for y := bounds.Min.Y; y < bounds.Max.Y; y++ {
		for x := bounds.Min.X; x < bounds.Max.X; x++ {
			r, g, b, a := img.At(x, y).RGBA()

			// 转换为 8-bit
			r8 := uint8(r >> 8)
			g8 := uint8(g >> 8)
			b8 := uint8(b >> 8)

			// 随机扰动 LSB
			r8 = (r8 & 0xFE) | uint8(rand.Intn(2))
			g8 = (g8 & 0xFE) | uint8(rand.Intn(2))
			b8 = (b8 & 0xFE) | uint8(rand.Intn(2))

			newColor := color.RGBA{r8, g8, b8, uint8(a >> 8)}
			newImg.Set(x, y, newColor)
		}
	}
	return newImg
}

// ImageRGBDisturb 对图像像素颜色进行随机扰动，强度范围 [0,255]
func ImageRGBDisturbAdjust(img image.Image, strength int) image.Image {
	if strength < 0 {
		strength = 0
	} else if strength > 255 {
		strength = 255
	}

	bounds := img.Bounds()
	rand.Seed(time.Now().UnixNano())
	newImg := image.NewRGBA(bounds)

	for y := bounds.Min.Y; y < bounds.Max.Y; y++ {
		for x := bounds.Min.X; x < bounds.Max.X; x++ {
			r, g, b, a := img.At(x, y).RGBA()

			// 转换为 8-bit
			r8 := uint8(r >> 8)
			g8 := uint8(g >> 8)
			b8 := uint8(b >> 8)

			// 生成扰动值（正负随机）
			dr := rand.Intn(strength*2+1) - strength
			dg := rand.Intn(strength*2+1) - strength
			db := rand.Intn(strength*2+1) - strength

			// 应用扰动并截断在 0~255 范围
			r8 = clampUint8(int(r8) + dr)
			g8 = clampUint8(int(g8) + dg)
			b8 = clampUint8(int(b8) + db)

			newImg.Set(x, y, color.RGBA{r8, g8, b8, uint8(a >> 8)})
		}
	}
	return newImg
}

// clampUint8 限制数值在 0~255
func clampUint8(v int) uint8 {
	if v < 0 {
		return 0
	}
	if v > 255 {
		return 255
	}
	return uint8(v)
}

// clamp 限制像素值在 [0,255]
func clamp(v int) int {
	if v < 0 {
		return 0
	}
	if v > 255 {
		return 255
	}
	return v
}

// ProcessImageDisturb 对输入图像进行轻度像素扰动并返回新的 image.Image
func ProcessImageDisturb(img image.Image) image.Image {
	bounds := img.Bounds()
	width, height := bounds.Dx(), bounds.Dy()

	// 转换为 RGBA 图像以便修改像素
	rgba := image.NewRGBA(bounds)
	draw.Draw(rgba, bounds, img, bounds.Min, draw.Src)

	rand.Seed(time.Now().UnixNano())

	// 扰动次数：最多 15 次 或者像素总数的 1/100
	pixelCount := width * height
	iterations := 15
	if pixelCount/100 < iterations {
		iterations = pixelCount / 100
	}

	for i := 0; i < iterations; i++ {
		y := rand.Intn(height)
		x := rand.Intn(width)
		c := rand.Intn(3)       // 随机选择 R/G/B 通道
		val := rand.Intn(5) - 2 // [-2, +2] 随机扰动

		offset := rgba.PixOffset(x, y)
		r := int(rgba.Pix[offset+0])
		g := int(rgba.Pix[offset+1])
		b := int(rgba.Pix[offset+2])

		switch c {
		case 0:
			r = clamp(r + val)
		case 1:
			g = clamp(g + val)
		case 2:
			b = clamp(b + val)
		}

		rgba.Pix[offset+0] = uint8(r)
		rgba.Pix[offset+1] = uint8(g)
		rgba.Pix[offset+2] = uint8(b)
	}

	return rgba
}

// saveImageAsJPEG 将图像保存为 JPEG 到指定路径
func SaveImageAsJPEG(img image.Image, path string) error {
	// 创建输出文件夹（如果不存在）
	if err := os.MkdirAll(getDir(path), os.ModePerm); err != nil {
		return err
	}

	outFile, err := os.Create(path)
	if err != nil {
		return err
	}
	defer outFile.Close()

	return jpeg.Encode(outFile, img, &jpeg.Options{Quality: 95})
}

// getDir 提取路径的文件夹部分
func getDir(path string) string {
	lastSlash := -1
	for i := len(path) - 1; i >= 0; i-- {
		if path[i] == '/' || path[i] == '\\' {
			lastSlash = i
			break
		}
	}
	if lastSlash == -1 {
		return "."
	}
	return path[:lastSlash]
}

// 使用 JPEG 编码图像后计算其 MD5
func CalculateJPEGMD5(img image.Image, quality int) (string, error) {
	var buf bytes.Buffer
	err := jpeg.Encode(&buf, img, &jpeg.Options{Quality: quality})
	if err != nil {
		return "", err
	}

	hash := md5.New()
	if _, err := io.Copy(hash, &buf); err != nil {
		return "", err
	}
	return hex.EncodeToString(hash.Sum(nil)), nil
}

// 过人脸数据
func GetFaceBase64() (image.Image, error) {
	imgBase64 := ""
	img, err := Base64ToImage(imgBase64)
	if err != nil {
		return nil, err
	}

	return img, nil
}

// base64转图片
func Base64ToImage(base64Str string) (image.Image, error) {
	// 1. 解码Base64字符串
	decoded, err := base64.StdEncoding.DecodeString(base64Str)
	if err != nil {
		return nil, fmt.Errorf("base64解码失败: %w", err)
	}

	// 2. 创建字节读取器
	reader := bytes.NewReader(decoded)

	// 3. 解码图像（自动检测格式）
	img, _, err := image.Decode(reader)
	if err != nil {
		return nil, fmt.Errorf("图像解码失败: %w", err)
	}

	return img, nil
}
func GetImageShape(img image.Image) (height, width, channels int) {
	b := img.Bounds()
	width = b.Dx()
	height = b.Dy()

	switch img.(type) {
	case *image.RGBA, *image.NRGBA, *image.NRGBA64, *image.RGBA64:
		channels = 3 // 或 4——看你模型是否使用 RGB 或 RGBA
	case *image.Gray, *image.Gray16:
		channels = 1
	default:
		// 无法确定 → 默认按 RGB 处理
		channels = 3
	}

	return
}
